import React from "react";
import HomePage from "./homePage";
import styled from "styled-components";

import Footer from "./Footer";
import Content from "./content";

export default function LandingPage() {
  return (
    <React.Fragment>
      <Container>
        <BackgroundImage>
          <HomePage />
        </BackgroundImage>
        <Content />
        <Footer />
      </Container>
    </React.Fragment>
  );
}

const Container = styled.div`
  
  display:flex;
  flex-direction:column;
  color:white;
  gap:20px;
  width: 100%;
  height:2000px;
  background-color: #111827;
   z-index: 10;
`;

const BackgroundImage = styled.div`
  z-index: 0;
  height: 100vh;
  width: 100vw;
  position: absolute;
  top: 0;
  left: 0;
  background-image: 
    linear-gradient(
      to top, 
      rgba(0, 0, 60, 0.8) 20%, 
      rgba(0, 0, 0, 0.4) 50%, 
      rgba(0, 0, 0, 0.4) 70%, 
      rgba(0, 0, 0, 0.8) 90%
    ), 
    url("https://img.freepik.com/premium-photo/man-wearing-headphones-front-purple-background_883149-208.jpg");
  background-size: cover;
  background-position: center;
`;
